class Solution:

    def calculateMinimumHP(self, dungeon: List[List[int]]) ->int:
        m = len(dungeon)
        n = len(dungeon[0])
        dp = [([0] * n) for _ in range(m)]
        dp[m - 1][n - 1] = min(0, -dungeon[m - 1][n - 1]) + 1
        for i in range(m - 2, -1, -1):
            dp[i][n - 1] = min(0, dp[i + 1][n - 1] - dungeon[i][n - 1]) + 1
        for j in range(n - 2, -1, -1):
            dp[m - 1][j] = min(0, dp[m - 1][j + 1] - dungeon[m - 1][j]) + 1
        for i in range(m - 2, -1, -1):
            for j in range(n - 2, -1, -1):
                dp[i][j] = min(0, max(dp[i + 1][j], dp[i][j + 1]) - dungeon[i
                    ][j]) + 1
        return dp[0][0]

