def bfs(graph, start, end):
    queue = [(start, 0)]
    visited = {start}
    while queue:
        node, dist = queue.pop(0)
        if node == end:
            return dist
        for neighbor, capacity in graph[node]:
            if neighbor not in visited:
                visited.add(neighbor)
                queue.append((neighbor, dist + capacity))
    return 0


