    for _ in range(m):
        u, v = map(int, input().split())
        edges.append((u - 1, v - 1))
    graph = [[] for _ in range(n)]
    for u, v in edges:
        graph[u].append(v)
    min_cost = float('inf')
    num_ways = 0
    for i in range(1 << n):
        covered = set()
        checkpost_positions = []
        for j in range(n):
            if i >> j & 1:
                checkpost_positions.append(j)
                covered.add(j)
        if not checkpost_positions:
            continue
        is_valid = True
        for u, v in edges:
            if u in covered and v not in covered:
                is_valid = False
                break
            if v in covered and u not in covered:
                is_valid = False
                break
        if is_valid:
            cost = sum(costs[j] for j in checkpost_positions)
            min_cost = min(min_cost, cost)
            num_ways = (num_ways + 1) % 1000000007
    print(min_cost, num_ways)


solve()

